i negara komunis maka Indonesia akan bergabung dengan Uni Soviet c.s. Indonesia akan lebih condong ke negara-negara komunis seperti negara-negara Eropa timur dan negara-negara komunis lain seperti China, Kuba, Korea Utara dll. Walaupun Blok Timur telah runtuh dan geng Soviet telah bubar tetapi hal itu tidak terlalu berdampak pada Indonesia.\r\nTidak ada kebebasan berbicara \r\nKebebasan berbicara adalah setiap hak idividu dan dilindungi undang-undang. Tetapi hal ini akan berbeda jika Indonesia menjadi negara komunis. Mulut kita seperti di belenggu, kita tidak boleh mengeluarkan pendapat, terlebih lagi jika menyangkut pemerintah. Salah bicara sedikit kita akan berakhir di kamp konsentrasi bersama para keluarga kita, bahkan nyawa bisa jadi taruhannya. Hal ini dapat kita lihat di Korea Utara, dimana baik individu maupun media dalam menyampaikan pendapat benar-benar dikontrol oleh negara.\r\nSistem satu partai\r\nDalam pemerintahan Komunis hanya terdapat satu partai yang berkuasa yaitu Partai Komunis. Partai –partai lain akan dilebur kedalam partai komunis atau apabila menetang pemerintah maka akan dibubarkan. Jadi tidak ada istilah partai oposisi\r\n\r\nPropaganda","image":"http://jcc.brandingyou.id/assets/images/1667980493.jpg","author":"Sahrul Ramdan","created_at":"09-11-2022"},{"id":46,"title":"Bangkitkan komunis, 12 dosa besar Megawati di mata Rachmawati","content":"Politisi Gerindra Rachmawati Soekarnoputri meninggal dunia karena covid-19. Semasa hidup Rachmawati dikenal sangat bermusuhan dengan kakaknya Megawati Soekarnoputri.\r\n\r\n\r\n\r\n\r\n\r\nBahkan, keduanya sudah lama tak bertegur sapa, sampai ajal memisahkan mereka. Rachmawati pada satu kesempatan pernah menyatakan terakhir bertemu dengan Megawati pada 2013 lalu, saat suaminya Taufik Kiemas meninggal dunia.\r\n\r\nRachmawati bilang Megawati kacau\r\nPada Mei 2019 lalu, Rachmawati pernah berapi-api membacakan dosa-dosa kakaknya ke hadapan publik. Hal itu ketika Rachma menyampaikan unek-uneknya soal Megawati ketika dikulik jurnalis yang mewawancarainya.\r\nDia bahkan tak segan menyebut mantan presiden RI itu sebagai sumber kekacauan Indonesia. \"Ibu pernah bilang Megawati sumber kekacauan, kenapa?\" tanya jurnalis yang mewawancarainya.Ya, memang sejak awal. Dalam catatan saya dia punya 12 dosa yang saya rangkum. Salah satunya ketika dia menandatangani amandemen konstitusi kita, lalu penjualan BUMN, dan masih banyak lagi,\" kata dia, dikutip Sabtu 3 Juli 2021.","image":"http://jcc.brandingyou.id/assets/images/1667979859.jpg","author":"Sahrul Ramdan","created_at":"09-11-2022"},{"id":45,"title":"klkl","content":"klk","image":"http://jcc.brandingyou.id/assets/images/1667982604.jpg","author":"dry","created_at":"09-11-2022"},{"id":44,"title":"4 Skenario Pembunuhan Munir: Dibunuh di Mobil, Disantet hingga diracun di udara","content":"- Istri almarhum aktivis hak asasi manusia (HAM) , Suciwati menceritakan empat skenario pembunuhan suaminya yang ditemukan oleh Tim Pencari Fakta. Dalam buku yang ditulis Suci dengan tajuk \"Mencintai Munir\" TPF disebut menemukan dokumen yang garis besarnya memuat skenario untuk membunuh Munir. Dokumen tersebut ditemukan menjelang akhir masa kerja kedua TPF, pertengahan tahun 2005., \"Menjelang berakhir masa kerja kedua,  menemukan dokumen empat skenario pembunuhanmu,\" kata Suciwati. Dia tidak menceritakan secara detail skenario yang ada. Skenario pertama, Munir hendak dibunuh pada saat di dalam kendaraan darat seperti mobil., Skenario kedua adalah santet atau teluh. Kemudian skenario ketiga adalah upaya membunuh Munir dengan racun ketika berada di kantor Imparsial. \"Keempat, meracunimu di pesawat,\" ucap Suci.","image":"http://jcc.brandingyou.id/assets/images/1667979275.jpg","author":"Sahrul Ramdan","created_at":"09-11-2022"},{"id":39,"title":"Mengenal Sahrul","content":"Syahrul Maulana Ismail, meraih Juara Harapan III kategori hifdzil 1 juz dan tilawah pada ajang musabaqah tilawatil quran (MTQ) tingkat nasional yang di selenggarakan di Banjarmasin, Oktober 2022.\r\n\r\nSyahrul menjadi satu-satunya khafilah yang menorehkan juara untuk Provinsi Papua pada ajang MTQ tahun 2022.\r\n\r\nIni merupakan pertama kalinya anak pertama dari Ustadz Ismail dan Husan Muchtar mengikuti lomba MTQ ke  tingkat nasional","image":"http://jcc.brandingyou.id/assets/images/1667974601.png","author":"Muhammad Pascal Rahmadi","created_at":"09-11-2022"},{"id":37,"title":"Inilah Kehebatan Sosok Om Kemal! Nomor 3 Bikin Ketar Ketir!!","content":"1. Penis Ta Agama 2. Penis Ta JS 3.Pemakan Abu Rokok","image":"http://jcc.brandingyou.id/assets/images/1667973457.png","author":"Sahrul Ramdan","created_at":"09-11-2022"},{"id":30,"title":"Nanang Modif","content":"See Instagram photos and videos from Nanang Modif (@putra_cikal_0021)","image":"http://jcc.brandingyou.id/assets/images/1667970095.jpg","author":"udinpetot","created_at":"09-11-2022"}]

